import React from "react";
// react plugin for creating charts
import ChartistGraph from "react-chartist";

// @material-ui/core components
import withStyles from "@material-ui/core/styles/withStyles";

// @material-ui/icons
import Timeline from "@material-ui/icons/Timeline";

// core components

import GridItem from "components/Grid/GridItem.jsx";

import Card from "components/Card/Card.jsx";
import CardHeader from "components/Card/CardHeader.jsx";
import CardIcon from "components/Card/CardIcon.jsx";
import CardBody from "components/Card/CardBody.jsx";
import CardFooter from "components/Card/CardFooter.jsx";

import chartsStyle from "assets/jss/material-dashboard-pro-react/views/chartsStyle.jsx";


const pieChart = {
    data: {
      labels: ["62%", "32%", "6%","5%", "79%","6%","5%", "79%"],
      series: [62, 32, 6, 5, 79,  6, 5, 79]
    },
    options: {
      height: "230px",
      labelOffset: 80,
    },
    chartPadding: {
        top: 0,
        right: 0,
        bottom: 20,
        left: 0
      },
  };



class PieCharts extends React.Component {
  render() {
    const { classes } = this.props;
    return (
<div>
            <Card>
              <CardHeader color="danger" icon>
                <CardIcon color="danger">
                  <Timeline />
                </CardIcon>
                <h4 className={classes.cardIconTitle}>Pie Chart</h4>
              </CardHeader>
              <CardBody>
                <ChartistGraph
                  data={pieChart.data}
                  type="Pie"
                  options={pieChart.options}
                />
              </CardBody>
              <CardFooter stats className={classes.cardFooter}>
                <h6 className={classes.legendTitle}>Legend</h6>
                <i className={"fas fa-circle " + classes.info} /> Apple{` `}
                <i className={"fas fa-circle " + classes.warning} /> Samsung
                {` `}
                <i className={"fas fa-circle " + classes.success} /> Windows
                Phone{` `}
              </CardFooter>
            </Card>
      </div>
    );
  }
}

export default withStyles(chartsStyle)(PieCharts);
